import React from "react";
import { StyleSheet, TouchableOpacity, Text, View } from "react-native";

const SignIn = () => {
  return <View style={styles.blank}></View>;
};

const styles = StyleSheet.create({
  blank: {
    backgroundColor: "#5C3B28",
    width: "100%",
    height: "100%",
  },
});

export default SignIn;
